import { Container } from "react-bootstrap";
import "./style.css";

function Title() {
  return (
    <Container id="title">
      <h1>Beer Buddy Clone</h1>
      <h2>Like Beer Buddy but better</h2>
    </Container>
  );
}

export default Title;
